async function getDriveClient() {
  const oauth2Client = new google.auth.OAuth2(
    process.env.GMAIL_CLIENT_ID,
    process.env.GMAIL_CLIENT_SECRET,
    'https://developers.google.com/oauthplayground'
  );

  oauth2Client.setCredentials({
    refresh_token: process.env.GMAIL_REFRESH_TOKEN
  });

  return google.drive({ version: 'v3', auth: oauth2Client });
}

async function createDriveFolder(drive, parentFolderId, folderName) {
  try {
    // Cerca se esiste gi
    const searchResponse = await drive.files.list({
      q: `name='${folderName}' and '${parentFolderId}' in parents and mimeType='application/vnd.google-apps.folder' and trashed=false`,
      fields: 'files(id, name)',
      spaces: 'drive'
    });

    let folderId;

    if (searchResponse.data.files.length > 0) {
      console.log(` Cartella "${folderName}" gi esistente`);
      folderId = searchResponse.data.files[0].id;
    } else {
      // Crea nuova cartella
      const fileMetadata = {
        name: folderName,
        mimeType: 'application/vnd.google-apps.folder',
        parents: [parentFolderId]
      };

      const folder = await drive.files.create({
        requestBody: fileMetadata,
        fields: 'id, name, webViewLink'
      });

      folderId = folder.data.id;
      console.log(` Cartella "${folderName}" creata su Drive`);
    }

    // Rendi la cartella pubblica in sola visualizzazione
    try {
      await drive.permissions.create({
        fileId: folderId,
        requestBody: {
          role: 'reader',  // Sola visualizzazione
          type: 'anyone'   // Chiunque con il link
        }
      });
      console.log(` Cartella "${folderName}" resa pubblica in sola visualizzazione`);
    } catch (permError) {
      console.warn(` Non  stato possibile rendere pubblica la cartella:`, permError.message);
    }

    return folderId;
  } catch (error) {
    console.error(' Errore creazione cartella Drive:', error);
    throw error;
  }
}

async function uploadToDrive(drive, folderId, fileName, pdfBytes) {
  try {
    const { PassThrough } = require('stream');
    
    const fileMetadata = {
      name: fileName,
      parents: [folderId]
    };

    const bufferStream = new PassThrough();
    bufferStream.end(Buffer.from(pdfBytes));

    const media = {
      mimeType: 'application/pdf',
      body: bufferStream
    };

    const file = await drive.files.create({
      requestBody: fileMetadata,
      media: media,
      fields: 'id, name, webViewLink'
    });

    // Rendi il file pubblico in sola visualizzazione
    try {
      await drive.permissions.create({
        fileId: file.data.id,
        requestBody: {
          role: 'reader',  // Sola visualizzazione
          type: 'anyone'   // Chiunque con il link
        }
      });
    } catch (permError) {
      console.warn(` Non  stato possibile rendere pubblico il file:`, permError.message);
    }

    console.log(` "${fileName}" caricato su Drive (pubblico)`);
    return {
      url: file.data.webViewLink,
      fileId: file.data.id
    };
  } catch (error) {
    console.error(` Errore upload Drive "${fileName}":`, error);
    return null;
  }
}

