async function inviaEmailAttestato(gmail, destinatario, nomeCompleto, nomeEvento, driveUrl, pdfBytes, nomeFile) {
  try {
    if (!destinatario || destinatario === 'N/A' || !destinatario.includes('@')) {
      console.log(` Email non valida per ${nomeCompleto}, skip invio`);
      return false;
    }

    const subject = `Attestato di Partecipazione - ${nomeEvento}`;
    const body = `
Gentile ${nomeCompleto},

Siamo lieti di inviarti l'attestato di partecipazione per l'evento:
${nomeEvento}

Puoi visualizzare e scaricare il tuo attestato dal seguente link:
${driveUrl || 'Link non disponibile'}

L'attestato  anche allegato a questa email in formato PDF.

Qualora riscontrassi eventuali imprecisioni nei dati riportati, ti invitiamo a rispondere a questa email.

Cordiali saluti,
Sala Operativa Regionale Campania
Croce Rossa Italiana                                                                                                                                                  

+39 081 7810011 (Selezione 2)
sor.campania@cri.it
Via San Tommaso d'Aquino 15 
80133 Napoli
www.cricampania.it

    `.trim();

    // Crea email in formato RFC 2822
    const utf8Subject = `=?utf-8?B?${Buffer.from(subject).toString('base64')}?=`;
    const messageParts = [
      `From: SOR Campania <sor.campania@cri.it>`,
      `To: ${destinatario}`,
      `Subject: ${utf8Subject}`,
      'MIME-Version: 1.0',
      'Content-Type: multipart/mixed; boundary="boundary_mixed"',
      '',
      '--boundary_mixed',
      'Content-Type: text/plain; charset="UTF-8"',
      '',
      body,
      '',
      '--boundary_mixed',
      'Content-Type: application/pdf',
      `Content-Disposition: attachment; filename="${nomeFile}"`,
      'Content-Transfer-Encoding: base64',
      '',
      Buffer.from(pdfBytes).toString('base64'),
      '--boundary_mixed--'
    ];

    const message = messageParts.join('\n');
    const encodedMessage = Buffer.from(message)
      .toString('base64')
      .replace(/\+/g, '-')
      .replace(/\//g, '_')
      .replace(/=+$/, '');

    await gmail.users.messages.send({
      userId: 'me',
      requestBody: {
        raw: encodedMessage
      }
    });

    console.log(` Email inviata a ${destinatario}`);
    return true;

  } catch (error) {
    console.error(` Errore invio email a ${destinatario}:`, error.message);
    return false;
  }
}

